import React, { useState } from 'react';

function Register() {
  const [registerData, setRegisterData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    phoneNumber: '',
    password: '',
    confirmPassword: '',
  });

  const [validationError, setValidationError] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setRegisterData({ ...registerData, [name]: value });
  };

  const isEmailValid = (email) => {
    // Simple email validation
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    return emailRegex.test(email);
  };

  const isPhoneNumberValid = (phoneNumber) => {
    // Simple phone number validation (allow only digits and '+')
    const phoneRegex = /^[\d+]+$/;
    return phoneRegex.test(phoneNumber);
  };

  const isPasswordValid = (password) => {
    // Password validation (10 minimal length, one capital letter, one number, one special character)
    const passwordRegex = /^(?=.*[A-Z])(?=.*[0-9])(?=.*[!@#$%^&*])(.{10,})$/;
    return passwordRegex.test(password);
  };

  const handleRegisterSubmit = (e) => {
    e.preventDefault();

    // Validation checks
    if (!isEmailValid(registerData.email)) {
      setValidationError('Invalid email address');
      return;
    }

    if (!isPhoneNumberValid(registerData.phoneNumber)) {
      setValidationError('Invalid phone number');
      return;
    }

    if (!isPasswordValid(registerData.password)) {
      setValidationError(
        'Password must be at least 10 characters long and include at least one capital letter, one number, and one special character.'
      );
      return;
    }

    // Storing data (for now, in-memory storage)
    const storedUsers = JSON.parse(localStorage.getItem('registeredUsers')) || [];
    storedUsers.push(registerData);
    localStorage.setItem('registeredUsers', JSON.stringify(storedUsers));

    // Reset the form
    setRegisterData({
      firstName: '',
      lastName: '',
      email: '',
      phoneNumber: '',
      password: '',
      confirmPassword: '',
    });

    setValidationError(null);

    console.log('Registration Data:', registerData);
  };

  return (
    <form onSubmit={handleRegisterSubmit}>
      {validationError && <div className="text-red-500 mb-4">{validationError}</div>}
      <div className="mb-4">
        <label htmlFor="email" className="block text-sm font-medium text-gray-700">
          Email
        </label>
        <input
          type="email"
          id="email"
          name="email"
          value={registerData.email}
          onChange={handleInputChange}
          className="w-full px-4 py-2 border rounded-lg"
          required
        />
      </div>
      <div className="mb-4">
        <label htmlFor="firstName" className="block text-sm font-medium text-gray-700">
          First Name
        </label>
        <input
          type="text"
          id="firstName"
          name="firstName"
          value={registerData.firstName}
          onChange={handleInputChange}
          className="w-full px-4 py-2 border rounded-lg"
          required
        />
      </div>
      <div className="mb-4">
        <label htmlFor="lastName" className="block text-sm font-medium text-gray-700">
          Last Name
        </label>
        <input
          type="text"
          id="lastName"
          name="lastName"
          value={registerData.lastName}
          onChange={handleInputChange}
          className="w-full px-4 py-2 border rounded-lg"
          required
        />
      </div>      
      <div className="mb-4">
        <label htmlFor="phoneNumber" className="block text-sm font-medium text-gray-700">
          Phone Number
        </label>
        <input
          type="tel"
          id="phoneNumber"
          name="phoneNumber"
          value={registerData.phoneNumber}
          onChange={handleInputChange}
          className="w-full px-4 py-2 border rounded-lg"
          required
        />
      </div>
      <div className="mb-4">
        <label htmlFor="password" className="block text-sm font-medium text-gray-700">
          Password
        </label>
        <input
          type="password"
          id="password"
          name="password"
          value={registerData.password}
          onChange={handleInputChange}
          className="w-full px-4 py-2 border rounded-lg"
          required
        />
      </div>
      <div className="mb-4">
        <label htmlFor="confirmPassword" className="block text-sm font-medium text-gray-700">
          Confirm Password
        </label>
        <input
          type="password"
          id="confirmPassword"
          name="confirmPassword"
          value={registerData.confirmPassword}
          onChange={handleInputChange}
          className="w-full px-4 py-2 border rounded-lg"
          required
        />
      </div>
      <button
        type="submit"
        className="bg-purple-500 hover:bg-purple-600 text-white px-4 py-2 rounded-full w-full"
      >
        Register
      </button>
    </form>
  );
}

export default Register;
